package http

import (
	"encoding/hex"
	"fmt"
	"html/template"
	"path"
	"github.com/ethersphere/swarm/api"
	"github.com/ethersphere/swarm/api/http/templates/data"
)

type htmlListData struct {
	URI  *api.URI
	List *api.ManifestList
}

var TemplatesMap = make(map[string]*template.Template)
var faviconBytes []byte

func init() {
	for _, v := range []struct {
		templateName string
		funcs        template.FuncMap
	}{
		{
			templateName: "error",
		},
		{
			templateName: "bzz-list",
			funcs: template.FuncMap{
				"basename": path.Base,
				"leaflink": leafLink,
			},
		},
		{
			templateName: "landing-page",
		},
	} {
		TemplatesMap[v.templateName] = template.Must(template.New(v.templateName).Funcs(v.funcs).Parse(getTemplateString(v.templateName)))
	}
	bytes, err := hex.DecodeString(favicon)
	if err != nil {
		panic(err)
	}
	faviconBytes = bytes
}

func leafLink(URI api.URI, manifestEntry api.ManifestEntry) string {
	return fmt.Sprintf("/bzz:/%s/%s", URI.Addr, manifestEntry.Path)
}

func wrapDefinition(definition string, content []byte) string {
	return fmt.Sprintf(`{{define "%s"}}%s{{end}}`, definition, string(content))
}

func getTemplateString(templateName string) string {

	js, err := data.Asset("api/http/templates/shared/js/script.js")
	if err != nil {
		panic(err)
	}
	css, err := data.Asset("api/http/templates/shared/css/style.css")
	if err != nil {
		panic(err)
	}
	base, err := data.Asset("api/http/templates/shared/base.tmpl")
	if err != nil {
		panic(err)
	}
	content, err := data.Asset(fmt.Sprintf("api/http/templates/%s.tmpl", templateName))
	if err != nil {
		panic(err)
	}
	tmpl := wrapDefinition("js", js) + wrapDefinition("css", css) + string(base) + wrapDefinition("content", content)
	return tmpl
}

const favicon = ``
